import React from 'react';
import styled from 'styled-components';

// Création du bouton avec Styled Components et Tailwind CSS
const StyledButton = styled.button`
  @apply flex items-center gap-1.5 p-2 self-stretch bg-red border border-gray-200 rounded-lg shadow-sm;

  color: #000;
  font-size: 100px;
  font-style: normal;
  font-weight: 600;
  line-height: normal;
  letter-spacing: -0.154px;

  &:hover {
    @apply bg-gray-100;
  }

  &:active {
    @apply bg-gray-200;
  }
`;

const Button = ({ children }) => {
  return <PageButton>{children}</PageButton>;
};

export default Button;
